from collections import Counter


class Solution:
    def balancedString(self, s: str) -> int:
        q = s.count("Q")
        w = s.count("W")
        e = s.count("E")
        r = s.count("R")
        l = len(s) // 4
        extra = {"Q": max(q - l, 0), "W": max(w - l, 0), "E": max(e - l, 0), "R": max(r - l, 0)}
        distance = (abs(l - q) + abs(l - w) + abs(l - e) + abs(l - r)) // 2
        print(len(s), distance)
        while True:
            count = {"Q": 0, "W": 0, "E": 0, "R": 0}
            for i in range(len(s) - distance + 1):
                if i == 0:
                    for j in s[i:i + distance]:
                        count[j] += 1
                else:
                    count[s[i - 1]] -= 1
                    count[s[i + distance - 1]] += 1
                # print(s[i:i + distance])
                # print(count)
                # print(extra)
                if extra["Q"] <= count["Q"] and extra["W"] <= count["W"] \
                        and extra["E"] <= count["E"] and extra["R"] <= count["R"]:
                    return distance
            distance += 1


s = Solution()
print(s.balancedString(
    ""))
